import React,{ useState, useEffect } from 'react';

const MainPage = () => {

    const [bannerUrl, setBannerUrl] = useState("https://www.dunkindonuts.co.kr/menu/view?cat=1&sub=1&id=5587");
    const [bannerImg, setBannerImg] = useState("/resources/img/2ICxlQlxjI6yOAPZFX3pGBpinqOUpCEAaO1cPqFm.png");
    const [bannerBut, setBannerBut] = useState('bnBut1');
    const [bannerIndex, setBannerIndex] = useState(1);
    const [bannerCount, setBannerCount] = useState(0);
    let time = 0;

//     const bannerTime = () =>{
//     if(time == 0){
//         setInterval(()=>{ 
//             setBannerIndex(bannerIndex===3?1:bannerIndex+1)
//         }, 5000)
//         time = 1
//     }else if(time == 1){
//         setInterval(()=>{ 
//             setBannerIndex(bannerIndex===3?1:bannerIndex+1)
//         }, 5000)
//         time = 0
//     }
    
//     setBannerCount(bannerCount+1)
//    }
    useEffect(()=>{
        let order = 1;
        setInterval(() => {
            bannerButten(order=3?1:order+1);
        }, 5000);
    },[bannerImg])

    const bannerButten = (e) =>{
        let pick = ""
        if(typeof e === 'string'){
            setBannerBut(e)
            pick = "bnBut"+e
        }else{
            setBannerBut(e.target.id)
            console.log(e.target.className)
            console.log(e.target.id)
            pick = e.target.id
        }
        if(pick === "bnBut1"){
            document.getElementById('bnBut1').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 !opacity-100 !w-[20px]";
            document.getElementById('bnBut2').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 ";
            document.getElementById('bnBut3').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 ";
            //setBannerIndex(1)        
            banner_img_href(1)    
        }else if(pick === "bnBut2"){
            document.getElementById('bnBut1').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 ";
            document.getElementById('bnBut2').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 !opacity-100 !w-[20px] ";
            document.getElementById('bnBut3').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 ";
            //setBannerIndex(2)
            banner_img_href(2)
        }else if(pick === "bnBut3" ){
            document.getElementById('bnBut1').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 ";
            document.getElementById('bnBut2').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 ";
            document.getElementById('bnBut3').className = "bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40 !opacity-100 !w-[20px]";
            //setBannerIndex(3)
            banner_img_href(3)
            
        }
       
    }
    const banner_img_href = (num) =>{

        switch(num){
            case 1 : setBannerImg("/resources/img/2ICxlQlxjI6yOAPZFX3pGBpinqOUpCEAaO1cPqFm.png")
                     setBannerUrl("https://www.dunkindonuts.co.kr/menu/view?cat=1&sub=1&id=5587")
                     //bannerButten("bnBut1")
            break;     
            case 2 : setBannerImg("/resources/img/a7OUkDWNmrKd0i2DM7IefeE8lxOvUgIhCjtSX3Rd.png")
                     setBannerUrl("https://www.dunkindonuts.co.kr/menu/viewProductCat?cat=3&sub=28&id=68")
                    // bannerButten("bnBut2")
            break;     
            case 3 : setBannerImg("/resources/img/NhKu3wzNU0AOc48qysjJtksUVlbJS6bDLBjj7EEW.png")
                     setBannerUrl("https://blog.naver.com/dunkin_kr/223580576950")
                    // bannerButten("bnBut3")
            break;         
        }

    }

//     useEffect(() =>{
//         console.log(document.getElementById("banner_href").href)

//         switch(bannerIndex){
//             case 1 : setBannerImg("/resources/img/2ICxlQlxjI6yOAPZFX3pGBpinqOUpCEAaO1cPqFm.png")
//                      setBannerUrl("https://www.dunkindonuts.co.kr/menu/view?cat=1&sub=1&id=5587")
//                      //bannerButten("bnBut1")
//             break;     
//             case 2 : setBannerImg("/resources/img/a7OUkDWNmrKd0i2DM7IefeE8lxOvUgIhCjtSX3Rd.png")
//                      setBannerUrl("https://www.dunkindonuts.co.kr/menu/viewProductCat?cat=3&sub=28&id=68")
//                     // bannerButten("bnBut2")
//             break;     
//             case 3 : setBannerImg("/resources/img/NhKu3wzNU0AOc48qysjJtksUVlbJS6bDLBjj7EEW.png")
//                      setBannerUrl("https://blog.naver.com/dunkin_kr/223580576950")
//                     // bannerButten("bnBut3")
//             break;         
//         }

//         // bannerTime()
//    },[bannerBut])
       


    
    // useEffect(() =>{
    //     setInterval(()=>{ 
    //         setBannerIndex(bannerIndex ==3?1:bannerIndex+1)
    //     }, 5000);
    // },[bannerUrl,bannerImg])

    return (
        <> < div > 
        <section
            className="bg-[url('/resources/images/main/top-bg.png')] relative overflow-hidden md:py-[33px] tab:pt-[clamp(11px,3.32vw,52px)] pb-[60px] tab:pb-[clamp(15px,4.3vw,63px)] md:px-[30px]">
            <div className="max-w-[1566px] mx-auto relative">
                <img
                    src="https://www.dunkindonuts.co.kr/build/assets/top-frame-ad543672.png"
                    
                    alt="banner"
                    className="absolute w-full h-full z-[1] pointer-events-none touch-none"/>
                <div
                    className="w-full h-full rounded-[clamp(20px,6.48vw,95px)] shadow-[2px_2px_18px_#A88D76] overflow-hidden">
                    <div className="flex w-full" style={{transform: "translate3d(-4364.6px, 0px, 0px)"}}>
                        <a
                            id='banner_href'
                            className="block flex-none w-full h-full aspect-[1566/749] relative"
                            target="_blank"
                            href={bannerUrl}
                           
                            style={{transform: "translate3d(4377px, 0px, 0px)"}}>
                            <img
                                id='banner_img'
                                src = {bannerImg}
                                
                                alt="banner"
                                className="w-full h-full object-cover aspect-[1566/749]"/></a>
                        {/* <a
                            className="block flex-none w-full h-full aspect-[1566/749] relative"
                            target="_blank"
                            href="https://www.dunkindonuts.co.kr/menu/viewProductCat?cat=3&sub=28&id=68">
                            <img
                                src="/resources/img/a7OUkDWNmrKd0i2DM7IefeE8lxOvUgIhCjtSX3Rd.png"
                                alt="banner"
                                className="w-full h-full object-cover aspect-[1566/749]"/>

                        </a>
                        <a
                            className="block flex-none w-full h-full aspect-[1566/749] relative"
                            target="_blank"
                            href="https://blog.naver.com/dunkin_kr/223580576950">
                            <img
                                src="/resources/img/NhKu3wzNU0AOc48qysjJtksUVlbJS6bDLBjj7EEW.png"
                                alt="banner"
                                className="w-full h-full object-cover aspect-[1566/749]"/></a> */}
                    </div>
                </div>
                <div className="absolute bottom-[42px] left-1/2 -translate-x-1/2">
                    <div className="flex justify-center">
                        <button type="button" className="px-[4px] py-[7px]" >
                            <div 
                                className="bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40  !opacity-100 !w-[20px] "id="bnBut1" onClick={bannerButten}></div>
                        </button>
                        <button type="button" className="px-[4px] py-[7px]" >
                            <div className="bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40" id="bnBut2" onClick={bannerButten}></div>
                        </button>
                        <button type="button" className="px-[4px] py-[7px]" >
                            <div className="bg-white rounded-full h-[7px] transition-all w-[7px] opacity-40"id="bnBut3" onClick={bannerButten}></div>
                        </button>
                    </div>
                </div>
            </div>
            <div
                className="md:absolute top-0 left-0 w-full h-full md:px-[clamp(15px,7.32vw,75px)] tab:px-[clamp(20px,5.46vw,80px)] md:py-[33px] tab:pt-[clamp(11px,3.32vw,52px)] tab:pb-[clamp(15px,4.3vw,63px)] pointer-events-none">
                <div
                    className="max-w-[1466px] flex justify-center md:justify-end mx-auto h-full md:py-[clamp(20px,2.73vw,40px)]">
                    <div
                        className="w-[87.6%] md:w-[39.5%] tab:w-[27%] xl:max-w-[372px] flex flex-col justify-center gap-[12px] tab:gap-[6px] xl:gap-[12px] pointer-events-auto">
                        <div
                            className="rounded-[32px] md:rounded-[clamp(10px,2.32vw,34px)] md:rounded-tr-[clamp(10px,3.82vw,56px)] aspect-[372/394] flex flex-col justify-center md:justify-start relative overflow-hidden">
                            <div className="h-full">
                                <div className="flex h-full" style={{transform: "translate3d(0px, 0px, 0px)"}}>
                                    <a
                                        className="block w-full flex-none h-full -ml-[1px] gtm-click"
                                        href="https://www.dunkindonuts.co.kr/menu/view?cat=1&sub=1&id=5587"
                                        target="_blank"
                                        data-gtm-click="클릭-탑배너도넛(켈로그콘푸로스트우유도넛)"
                                        style={{backgroundColor: "rgb(253, 123, 59)"}}>
                                        <img
                                            src="/resources/img/nCzLd57hslMRNkfyvX20zkXzoZ4ZdIZKAMs5Dm4E.png"
                                            className="w-[78%] md:w-[74%] tab:w-[70%] xl:w-[78%] aspect-square mx-auto"/>
                                        <div className="text-center text-white">
                                            <div
                                                className="text-[clamp(10px,5.9vw,21px)] xs:text-[22px] md:text-[clamp(10px,2.2vw,22px)] tab:text-[clamp(17px,1.5vw,24px)] leading-none font-[DunkinSans] opacity-50 [&_.text-tiny]:text-[clamp(7px,4vw,17px)] [&_.text-tiny]:xs:text-[16px] md:[&_.text-tiny]:text-[clamp(10px,1.8vw,15px)] tab:[&_.text-tiny]:text-[clamp(13px,1.2vw,18px)] [&_.text-small]:text-[clamp(9px,4.5vw,19px)] [&_.text-small]:xs:text-[18px] md:[&_.text-small]:text-[clamp(10px,2vw,20px)] tab:[&_.text-small]:text-[clamp(14px,1.4vw,21px)]">
                                                <p>
                                                    <style type="text/css"></style>
                                                    <span className="text-tiny" style={{color: "rgb(133, 52, 20)"}}>KELLOGG CORNFROST MILK DONUT</span>
                                                </p>
                                            </div>
                                            <div
                                                className="text-[clamp(10px,6.66vw,24px)] xs:text-[24px] md:text-[clamp(10px,2.53vw,26px)] tab:text-[clamp(10px,1.77vw,26px)] font-extrabold">
                                                <p>
                                                    <span className="text-tiny" style={{color: "rgb(133, 52, 20)"}}>켈로그 콘푸로스트 우유도넛</span>
                                                </p>
                                            </div>
                                        </div>
                                    </a>
                                </div>
                            </div>
                            <div
                                className="absolute bottom-[2%] xs:bottom-[4%] tab:bottom-[3%] xl:bottom-[4%] left-1/2 -translate-x-1/2">
                                <div className="flex justify-center">
                                    <button type="button" className="px-[4px] py-[7px]">
                                        <div
                                            className="bg-white rounded-full h-[8px] transition-all w-[8px] opacity-40 !opacity-100 !w-[20px]"
                                            style={{backgroundColor: "rgb(133, 52, 20)"}}></div>
                                    </button>
                                </div>
                            </div>
                        </div>
                        <div className="space-y-[12px] tab:space-y-[6px] xl:space-y-[12px]">
                            <div
                                className="rounded-[32px] md:rounded-[clamp(10px,2.32vw,34px)] aspect-[372/175] relative overflow-hidden">
                                <div>
                                    <div className="flex" style={{transform: "translate3d(0px, 0px, 0px)"}}>
                                        <a
                                            className="w-full flex-none flex pl-[24px] md:pl-[clamp(10px,1.91vw,28px)] py-[6px] pr-[12px] justify-between -ml-[1px] gtm-click"
                                            href="https://www.dunkindonuts.co.kr/menu/view?cat=3&sub=28&id=5589"
                                            target="_blank"
                                            data-gtm-click="클릭-탑배너굿즈(켈로그콘푸로스트쿨라타)"
                                            style={{backgroundColor:"rgb(255, 94, 94)"}}>
                                            <div
                                                className="text-white relative top-[22%] [&:has(.text-tiny)]:top-[15%] [&:has(.text-small)]:top-[18%]">
                                                <div
                                                    className="text-[clamp(10px,6.66vw,24px)] xs:text-[24px] md:text-[clamp(10px,2.34vw,24px)] tab:text-[clamp(10px,1.63vw,24px)] whitespace-pre-line font-[DunkinSans,Pretendard] font-extrabold leading-[1.2]">
                                                    <p>
                                                        <span className="text-tiny">켈로그</span>
                                                    </p>
                                                    <p>
                                                        <span className="text-tiny">콘푸로스트</span>
                                                    </p>
                                                    <p>
                                                        <span className="text-tiny">쿨라타</span>
                                                    </p>
                                                </div>
                                            </div>
                                            <img
                                                src="/resources/img/ZVELC5B5Cm2AfkfK4Zpnaw5VJj0qNhXxG1EWfmYx.png"
                                                className="w-[49%] aspect-square"/></a>
                                    </div>
